import { Box, Typography } from '@mui/material'
import React from 'react'

const NavBar = () => {
  return (
    <Box sx={{display:"flex"}}>
        <Typography sx={{fontSize:"32px",boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.1)"}}>COZ Shopping</Typography>
    </Box>
  )
}

export default NavBar
